 menyesuaikan bentuk badan hukumnya menjadi DANA PENSIUN PERTAMINA (DP PERTAMINA). Direksi Pertamina mengeluarkan Surat Keputusan No.Kpts-144/C0000/97-S0 tanggal 20 Oktober 1997 tentang Peraturan Dana Pensiun dari DPP yang telah mendapatkan pengesahan dari Menteri Keuangan Republik Indonesia dengan Surat Keputusan No. KEP-007/KM.17/1998 tanggal 20 Januari 1998. Terakhir Peraturan Dana Pensiun Pertamina telah diperbaharui berdasarkan Surat Keputusan Direksi PT PERTAMINA (PERSERO) Nomor Kpts–46/C00000/2007–S0 tanggal 24 September 2007 dan telah mendapat pengesahan Menteri Keuangan Nomor KEP–102/KM.10/2008 tanggal 29 Mei 2008, diumumkan dalam Berita Negara Republik Indonesia tanggal 17 Juni 2008 Nomor 49 dan Tambahan Nomor 14.</p></div></div></div></section><div class=\"uk-margin-large-bottom\"></div>")],2)}
